import React from 'react'
//import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  //CONSTRUCTOR
  constructor(props){
    super(props)
    this.state = {
      personalFile: {},
      currentPilot: '',
    }
  }
  //METHODS
  handlePilotInput = (event) =>{
    event.preventDefault()
    this.setState({currentPilot: event.target.value})
  }

  //RENDER
  render() {
    return (
      <div >
        <h1>Pilot Microservice</h1>
      </div>
    )
  }
}

export default App;
